def merge_the_tools(string, k):
    n = int(len(string))
    factor = int(k)
    for i in range(0,n,factor):  #Running the Loop form "n" to provided width "K"
        sub_string_width = string[i:i+factor]
        sub_string = ""
        ''''
        n/k provides us with the number of lines provided as an output or with the 
        number of split strings without any duplicates
        '''
        for char in sub_string_width:
            if char not in sub_string:
                sub_string = sub_string+char   # Sorting the characters in sub-strings variable until "t-1"
        print(sub_string)

if __name__ == '__main__':
    string, k = input(), int(input())
    merge_the_tools(string, k)

